package com.kuanquan.universalcomponents.viewmodel

import com.kuanquan.universalcomponents.bean.AllWatchBean
import com.kuanquan.universalcomponents.bean.BannerBean
import com.kuanquan.universalcomponents.bean.UserEvaluationBean


class CommodityDetailsViewModel : MainBaseViewModel() {

    // 顶部轮播图
    fun topBannerData(): List<BannerBean> {
        val lists = ArrayList<BannerBean>()
        var bannerBean: BannerBean

        for (i in 0..5) {
            bannerBean = BannerBean()
            bannerBean.url =
                "data:image/jpeg;base64,"
            lists.add(bannerBean)
        }
        return lists
    }

    // 用户评价
    fun userList(): List<UserEvaluationBean> {
        val lists = ArrayList<UserEvaluationBean>()
        var mUserEvaluationBean: UserEvaluationBean

        for (i in 0..5) {
            mUserEvaluationBean = UserEvaluationBean()
            mUserEvaluationBean.headImage = "data:image/jpeg;base64,"
            mUserEvaluationBean.name = "杰克"
            mUserEvaluationBean.content = "非常满意"
            lists.add(mUserEvaluationBean)
        }

        return lists
    }

    // 大家读喜欢
    fun userHot(): List<BannerBean> {
        val lists = ArrayList<BannerBean>()
        var bannerBean: BannerBean

        var mAllWatchBean: AllWatchBean
        for (i in 0..5) {
            bannerBean = BannerBean()
            bannerBean.url =
                "data:image/jpeg;base64,"

            for (j in 0..2){
                mAllWatchBean = AllWatchBean()
                mAllWatchBean.des = "大风起兮云飞扬，下面的忘记了"
                mAllWatchBean.imageUrl = "http://img5.imgtn.bdimg.com/it/u=3987907653,720009510&fm=26&gp=0.jpg"
                mAllWatchBean.price = "34.89"
                mAllWatchBean.price_integral = "45.76"
                mAllWatchBean.title = "这是一个标题"
                bannerBean.datas.add(mAllWatchBean)
            }

            lists.add(bannerBean)
        }
        return lists
    }
}